import React from 'react'
import { Button, Card, Image } from 'semantic-ui-react'

const VideoCard = () => (
  <div className="video-card">
      <div className="video-card-details">
          <video>
              <source src="#" type="#"/>
          </video>
          <h4>Video Title</h4>
          <p>Youtube Name</p>
          <p>Views</p>
          <p>Date</p>
      </div>
  </div>
)


